// src/components/Footer.js
import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 E-Library. All rights reserved.</p>
      <p>Contact us: info@elibrary.com</p>
    </footer>
  );
};

export default Footer;
